INSERT INTO `post` (`postId`, `postTitle`, `postDescrip`, `postContent`, `postDate`, `postViews`, `postModerator`, `postImage`, `postPublished`, `postRejected`, `postController`) VALUES
(2, 'WESTWORLD', 'MOAB, UTAH: WHERE ADVENTURE BEGINS. \r\nEverything in the small town of Moab evolves around outdoor activities. During the high season hundreds of thousands of visitors are pulled in by the spectacular nature.', '&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;Hiking, rafting, canyoneering and, of course, mountain biking. With what should I start with, having just five days? So many options.&amp;nbsp;&lt;a href=&quot;http://discovermoab.com/&quot; rel=&quot;noopener&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 0, 0); transition: color 0.2s ease-in-out;&quot;&gt;Moab&lt;/a&gt;&amp;nbsp;is a paradise, whose beauty captures everybody as soon as you pull off Interstate 70 and turn south on Highway 191. Here, nature showcases the most spectacular desert landscapes ever sculpted by a creator. Bright red rock formations, thousands of massive, surreal sandstone arches, deep, cool canyons carved by the emerald green Colorado River in millions of years.&lt;/p&gt;&lt;blockquote style=&quot;margin: 30px -108px; font-stretch: normal; font-size: 36px; line-height: 48px; font-family: ff-meta-serif-web-pro, serif; text-align: center;&quot;&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto;&quot;&gt;I just can’t let go of the camera in my hands!&lt;/p&gt;&lt;/blockquote&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;This is not my first visit to the area. I’ve been here before, just passing through on my way from Colorado to Alaska. It was the end of May, the start of the tourist season, when thousands of visitors flock daily into the small town.&amp;nbsp;&lt;a href=&quot;https://www.nps.gov/arch/index.htm&quot; rel=&quot;noopener&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 0, 0); transition: color 0.2s ease-in-out;&quot;&gt;Arches National Park&lt;/a&gt;&amp;nbsp;itself, at the gates of Moab, draws more than 1,5 million people annually. Almost everybody comes by car or RV, trying to squeeze through the main street during the day. After only a short night camping along the Colorado I fled back then. Now the premises are much more promising. With peak season being over there is still a lot going on, but it feels a little slower paced. However, this week could become quite turbulent again. The annual&amp;nbsp;&lt;a href=&quot;http://moabhodown.com/&quot; rel=&quot;noopener&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 0, 0); transition: color 0.2s ease-in-out;&quot;&gt;Moab Ho-Down&lt;/a&gt;&amp;nbsp;is set, a colorful festival all about mountain biking. The experts are testing their skills with various races and competitions and fans can try out the world-class trails and celebrate with movies, a community ride and campfires.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto;&quot;&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; data-filename=&quot;JA6B6980Edit-1024x683.jpg&quot; style=&quot;width: 1024px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;But first, I want to explore the canyons. Michelle is my guide. «Those walls over there, gleaming in the sunshine, are called Wall Street. One of the easiest and most accessible climbing areas around here.» She points across the Colorado, where the road worms its way between steep rock walls and the river. «We got some petroglyphs right here to our left.» I can’t really see the paintings passing by in the car but will check them out on my way back later. Shortly after, we are pulling into a small parking area. It only took us fifteen minutes to get here from downtown Moab.&lt;/p&gt;&lt;blockquote style=&quot;margin: 30px -108px; font-stretch: normal; font-size: 36px; line-height: 48px; font-family: ff-meta-serif-web-pro, serif; text-align: center;&quot;&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto;&quot;&gt;Adventure is within reach everywhere.&lt;/p&gt;&lt;/blockquote&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;Ours for now is called&amp;nbsp;&lt;a href=&quot;http://cliffsandcanyons.com/canyoneering-trips/canyoneering-three-quarter-day-trip-hypatia-canyon/&quot; rel=&quot;noopener&quot; target=&quot;_blank&quot; style=&quot;color: rgb(0, 0, 0); transition: color 0.2s ease-in-out;&quot;&gt;Hypatia Canyon&lt;/a&gt;, a four mile long hike through rocky canyons and over petrified sand dunes to three rappels. Michelle has been here many times. «Everytime it’s different. New wildflowers are blooming, something’s turning yellow, leaves are falling off. It has just rained, so everything’s greener. Where the sunlight hits the rock changes with the season. The temperatures change with the season. You notice different colors. Do you see that white stripe up on the rock there? That’s a layer of limestone. Normally this used to be a really dry area with those sand dunes everywhere. And then there might have been a couple hundred thousand years where it was much wetter, there’d actually be a lake here. And then all the animals living in the lake died, creating sandstone at the bottom. Every time I’m surprised by something.»&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;During high season Michelle guides up to ten groups per week into the canyons. «There are definitely days when you feel tired. The sand feels a little deeper, the pack feels a little heavier», she jokes. But the people often are super-psyched about being out here, and that is contagious.&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;&lt;img style=&quot;width: 1024px;&quot; src=&quot;data:image/jpeg;base64,&quot; data-filename=&quot;JA6B6932Edit-1024x683.jpg&quot;&gt;&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;After one and a half hours we are approaching our first rappel. The trail until there has been steep, rather climbing over rocks than walking on a trail. But now we have reached a high plateau, where the view takes my breath away, even without the physical exercise. The sun beams from the deep blue, cloudless sky onto the red rock fins, that are reaching all the way to the horizon in gentle verves. In all directions narrow canyons are trenching the rock. Colorado mountains are shimmering from a distance. We deeply breathe in the clear dry air, pausing for a moment. Speechless.&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;«This is a 130 feet drop down there», Michelle breaks the silence. A few wind-beaten junipers are lining the rock edge, where we want to rappel from in just a few minutes. Exactly across, the giant Teardrop Arch swings across the canyon. We can hardly see the shady bottom, where we intend to land on. While Michelle starts preparing the ropes, I take off my backpack she gave me, scratched from many tight canyon walls. I put on the helmet and climbing harness and slip into the working gloves from the hardware store. They will protect the hands from heat caused by friction of the lines while rappeling. Michelle anchors the lines at one of the junipers. «I would guess it’s a couple of hundred years old. Maybe you think it’s not that big, but the root structure is twice as big as what we see here. There are roots growing into all the little crevasses around us. This guy is not going anywhere», she tries to calm me down after the rope is connected to my harness and I slowly start to shift my weight backward, my heart pounding. In small steps I now start to walk towards the rock edge, noticing how all the muscles seem to harden. Weird feeling. And a plea of the basic instinct that I trustfully hand over to Michelle as she secures me while I tumble into the unknown.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;text-align: left; margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;&lt;span style=&quot;font-size: 36px; text-align: center;&quot;&gt;I risk glancing down into the deep, like a scary black throat below me.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;Now, I become even tighter and refocus on the rope in front of me. Keep it tight, release it, step by step. The closer I get to the bottom, the more my tightness vanishes. I finally reach the bottom. Made it! The adrenaline still pumping through my veins. I can feel the rush as I look around, watching the play between light and shade in the canyon, observing how the sunrays first graze the arch and then touch the fine, red sand next to me. Let’s do it again! Right away!&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;«I like the idea that it’s got all these twists and turns, obstacles up and down, you never know what’s around the corner», Michelle raves about canyoneering after rappelling down to me. Next, we slide across the rock into a small, waist-deep pool of ice cold, muddy water. Then the canyon widens, the leaves of cottonwood trees rattle in the breeze as the sun dries us while we continue hiking.&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;&lt;img style=&quot;width: 1082px;&quot; src=&quot;data:image/jpeg;base64,&quot; data-filename=&quot;JA6B7033Edit.jpg&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;In the next hour we will crawl over a wedged trunk through a small gorge, plunge into another pool and rappel two more times, the last one being a stunning 100 feet drop, levitating. Then my first adventure in the outdoor paradise ends. And I already realize, that it doesn’t take much to hopelessly fall in love with this place.&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;«I like the community here, that always supports each other. There’s always somebody ready to climb. There are so many things to do here.» Michelle still sounds excited, even after many years living in Moab.&lt;/p&gt;&lt;p style=&quot;margin: 1em 0px; -webkit-hyphens: auto; font-family: ff-meta-serif-web-pro, serif; font-size: 20px;&quot;&gt;«And then looking at the scenery around you, the colors, red rocks, blue skies, green trees, the snow on the rock. Out here there’s plenty of open space, that’s part of why I moved here. And I like the fact that it’s a small town. It’s cool that people travel a long distance to see what we have to offer.»&lt;/p&gt;', '2020-04-15 02:09:19', 93, 8, 'jpg', 1, 0, 1);
INSERT INTO `post` (`postId`, `postTitle`, `postDescrip`, `postContent`, `postDate`, `postViews`, `postModerator`, `postImage`, `postPublished`, `postRejected`, `postController`) VALUES
(11, 'Travel To Iceland', 'Icelanders are often asked: what do you recommend? What are the most exciting and unique things to do in Iceland? Where can you find the country’s most beautiful locations and landmarks? Read on to discover our suggestions for what to do and where to go in Iceland.', '&lt;div&gt;&lt;p dir=&quot;ltr&quot;&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; data-filename=&quot;what-to-do-amp-where-to-go-in-iceland-19.jpg&quot; style=&quot;width: 685.6px;&quot;&gt;n island of striking landscapes, where rivers run through deserts and molten lava erupts from ice. Iceland is a realm of stark contrasts.&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;It is a country where the natural elements dance between the poles of fire and frost, during winters with endless nights, and summers where the sun never sets.&lt;/p&gt;&lt;/div&gt;&lt;div&gt;&lt;p&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;It can be a little overwhelming, therefore, to decide what to do and where to go in Iceland. Before you book your trip, there is a lot to take into account&lt;/p&gt;&lt;h2 dir=&quot;ltr&quot;&gt;&lt;strong&gt;Discover the Wonders of Snaefellsnes Peninsula&lt;/strong&gt;&lt;/h2&gt;&lt;h2 dir=&quot;ltr&quot;&gt;&lt;p dir=&quot;ltr&quot;&gt;If you want to see the diverse landscapes and features of Iceland, all you need to do is&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/travel-iceland/drive/snaefellsnes&quot;&gt;plan a day trip to the Snæfellsnes Peninsula&lt;/a&gt;.&lt;br&gt;&lt;br&gt;Snaefellsnes has been nicknamed ‘Iceland in Miniature’ due to the sheer variety of landscapes you can see on the peninsula. While all are unique and beautiful, none compare to its crowning glory,&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/travel-iceland/drive/snaefellsjokull&quot;&gt;Snæfellsjökull glacier&lt;/a&gt;.&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;Snæfellsjökull is a twin-peaked glacier that sits over a volcano on the peninsula’s tip, surrounded by jagged lava fields and a dramatic coastline on three sides. You can see it from some of the area’s other top attractions, such as the all-but-abandoned&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/travel-iceland/drive/budir&quot;&gt;hamlet of Búðir&lt;/a&gt;&amp;nbsp;and the&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/travel-iceland/drive/londrangar&quot;&gt;Lóndrangar sea stacks&lt;/a&gt;.&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; data-filename=&quot;what-to-do-amp-where-to-go-in-iceland-1.jpg&quot; style=&quot;width: 685.6px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;div&gt;Snæfellsjökull can be seen in clear weather from&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/travel-iceland/drive/reykjavik&quot;&gt;Reykjavík&lt;/a&gt;&amp;nbsp;by gazing across&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/travel-iceland/drive/faxafloi&quot;&gt;Faxaflói Bay&lt;/a&gt;, but there is no comparison to visiting the site itself.&lt;/div&gt;&lt;div&gt;&lt;/div&gt;&lt;/h2&gt;&lt;h2&gt;&lt;strong&gt;Stroll Down the Beaches of the South&lt;/strong&gt;&lt;/h2&gt;&lt;h2&gt;&lt;p dir=&quot;ltr&quot;&gt;&lt;a href=&quot;https://guidetoiceland.is/travel-iceland/drive/south-coast&quot;&gt;Iceland’s South Coast&lt;/a&gt;&amp;nbsp;is extremely popular among travellers.&amp;nbsp; It is a region everyone should consider visiting when deciding what to do in Iceland.&amp;nbsp;&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;If you decide to take&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/book-trips-holiday/day-tours/south-coast-tours&quot;&gt;a tour of the South Coast of Iceland&lt;/a&gt;, make sure to explore the black sand beaches that lay along the coastline.&amp;nbsp; While its waterfalls, glaciers and volcanoes are beautiful, it is the beaches here that make it truly unique.&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;Iceland’s glaciers and the effects of coastal erosion mean that the vast majority of its coastline is rocky and jagged, with fjords defining the West, North and East. Much of the South Coast, however, is vulnerable to glacial flooding, which has flattened the rocks into black sand.&lt;/p&gt;&lt;/h2&gt;&lt;h2 dir=&quot;ltr&quot;&gt;&lt;strong&gt;Enjoy Natural Treatments at the Blue Lagoon&lt;/strong&gt;&lt;/h2&gt;&lt;h2 dir=&quot;ltr&quot;&gt;&lt;p dir=&quot;ltr&quot;&gt;&lt;a href=&quot;https://guidetoiceland.is/travel-iceland/drive/blue-lagoon&quot;&gt;The Blue Lagoon is a geothermal spa&lt;/a&gt;&amp;nbsp;and perhaps the country’s most visited geothermal spa. The water here is an opaque, milky blue, unlike anything found elsewhere on earth.&amp;nbsp;&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; data-filename=&quot;what-to-do-amp-where-to-go-in-iceland-10.jpg&quot; style=&quot;width: 685.6px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;The hot pool is rich in minerals and thriving with good bacteria. Silica masks are available for all guests, too. Both the water and masks have granted the lagoon a reputation for healing.&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;The Blue Lagoon sits within incredible nature. It is located on the&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/travel-iceland/drive/reykjanes&quot;&gt;volcanic Reykjanes Peninsula&lt;/a&gt;, known for its stark and haunting landscapes. The lagoon is conveniently located just ten minutes from&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/travel-iceland/drive/keflavik-international-airport&quot;&gt;Keflavík International Airport&lt;/a&gt;&amp;nbsp;and thirty minutes from Reykjavik city centre, making it the perfect place to start or end a holiday. There are&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/book-trips-holiday/bus-tours/airport-transfers&quot;&gt;a range of airport transfers&lt;/a&gt;&amp;nbsp;to choose from, many of which will stop at The Blue Lagoon.&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;Please note that the Blue Lagoon is a top-rated attraction in Iceland and you must, therefore,&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/book-trips-holiday/nature-tours/blue-lagoon&quot;&gt;book your admission ticket&lt;/a&gt;&amp;nbsp;in advance.&lt;/p&gt;&lt;/h2&gt;&lt;h2&gt;&lt;strong&gt;Go Whale Watching in Husavik&lt;/strong&gt;&lt;/h2&gt;&lt;h2&gt;&lt;p dir=&quot;ltr&quot;&gt;Over twenty species of whale, dolphin and porpoise can be found in Iceland’s waters, making it a top destination for whale-watching.&amp;nbsp;&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; data-filename=&quot;this-tour-lets-you-get-up-close-and-personal-with-the-whales-4.jpg&quot; style=&quot;width: 674px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;While boat tours head out from ports such as Reykjavík and&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/travel-iceland/drive/akureyri&quot;&gt;Akureyri&lt;/a&gt;, in places such as the&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/travel-iceland/drive/westfjords&quot;&gt;Westfjords&lt;/a&gt;&amp;nbsp;you can catch sight of whales from shore. The most successful tours usually set out from the&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/travel-iceland/drive/husavik&quot;&gt;small northern town of Húsavík&lt;/a&gt;.&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;Often nicknamed the whale watching capital of Europe, Húsavik sits by Skjálfandi Bay, which teems with aquatic life throughout the summer. Spot harbour porpoises, white-beaked dolphins and humpback whales almost every day.&amp;nbsp;&lt;/p&gt;&lt;/h2&gt;&lt;h2&gt;&lt;strong&gt;Explore the Lake Myvatn Geothermal Area&lt;/strong&gt;&lt;/h2&gt;&lt;h2&gt;&lt;p dir=&quot;ltr&quot;&gt;Around an hour’s drive east of the ‘Capital of North Iceland’, Akureyri, is a geological and geothermal wonderland called the&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/travel-iceland/drive/myvatn&quot;&gt;Lake Mývatn&lt;/a&gt;&amp;nbsp;area.&amp;nbsp;&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;&lt;img src=&quot;data:image/jpeg;base64,&quot; data-filename=&quot;what-to-do-amp-where-to-go-in-iceland-17.jpg&quot; style=&quot;width: 685.6px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;The lakes formed during a streak of catastrophic eruptions over two millennia ago.&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;The area now boasts a wealth of hidden gems that visitors can reach&amp;nbsp;&lt;a href=&quot;https://guidetoiceland.is/book-trips-holiday/day-tours/myvatn-tours-1&quot;&gt;by taking a tour of Myvatn&lt;/a&gt;.&lt;/p&gt;&lt;p dir=&quot;ltr&quot;&gt;The lakes themselves are beautiful, in their formation and the life that flourishes within them.&lt;span style=&quot;font-size: 24px;&quot;&gt;﻿&lt;/span&gt;&lt;/p&gt;&lt;/h2&gt;&lt;/div&gt;', '2020-04-20 07:33:15', 27, 27, 'jpg', 1, 0, 1);
INSERT INTO `post` (`postId`, `postTitle`, `postDescrip`, `postContent`, `postDate`, `postViews`, `postModerator`, `postImage`, `postPublished`, `postRejected`, `postController`) VALUES
(14, 'Agra', 'City in India', '&lt;p&gt;Agra is a city in northern India’s Uttar Pradesh state. It\'s home to the iconic Taj Mahal, a mausoleum built for the Mughal ruler Shah Jahan’s wife, Mumtaz Mahal (who died in childbirth in 1631). The imposing main building features a massive dome and intricately carved white marble inlaid with precious stones. This is set behind a reflecting pool inside a courtyard defined by 4 minarets.\r\n&lt;/p&gt;&lt;p&gt;The Taj Mahal was designated as a UNESCO World Heritage Site in 1983 for being &quot;the jewel of Muslim art in India and one of the universally admired masterpieces of the world\'s heritage&quot;. It is regarded by many as the best example of Mughal architecture and a symbol of India\'s rich history. The Taj Mahal attracts 7–8 million visitors a year and in 2007, it was declared a winner of the New7Wonders of the World (2000–2007) initiative.&lt;/p&gt;&lt;p&gt;Near the Taj Mahal are the 20m-high red-brick walls of Agra Fort, a grand Mughal fortress and palace, much of it dating to the 16th and 17th centuries. Across the Yamuna River is another striking tomb, Itimad-ud-Daula, which prefigures the Taj Mahal by a few years, earning it the nickname &quot;Baby Taj.” West of the city is the remarkably well-preserved “ghost city” of Fatehpur Sikri, whose red-sandstone royal apartments, harem quarters and pavilions date to the late 1500s, when it was briefly the capital of the Mughal empire.&lt;/p&gt;&lt;p&gt;May–Jun is very hot, before the Jul–Sep monsoon rains. Oct–Apr, comparatively dry and cool, is the peak travel season. Taj Mahotsav (Feb) is a cultural festival with folk dancing and arts and crafts from across India, plus regional cuisine. Ram Barat (Sep) is a recreation of a royal wedding with elaborate decorations and a huge procession with floats and dancing. Diwali (Oct/Nov, dates vary) is the Hindu festival of light, with fireworks and colorful street illuminations.&lt;/p&gt;', '2020-04-22 10:56:29', 12, 29, 'jpg', 1, 0, 26),
(15, 'Switzerland Essentials', 'Travel tips for Switzerland', '&lt;p&gt;Switzerland, federated country of central Europe. Switzerland’s administrative capital is Bern, while Lausanne serves as its judicial centre. Switzerland’s small size—its total area is about half that of Scotland—and its modest population give little indication of its international significance.&lt;/p&gt;&lt;p&gt;A landlocked country of towering mountains, deep Alpine lakes, grassy valleys dotted with neat farms and small villages, and thriving cities that blend the old and the new, Switzerland is the nexus of the diverse physical and cultural geography of western Europe, renowned for both its natural beauty and its way of life. Aspects of both have become bywords for the country, whose very name conjures images of the glacier-carved Alps beloved of writers, artists, photographers, and outdoor sports enthusiasts from around the world.&lt;/p&gt;&lt;p&gt;1. Join in the Fasnacht Spring Carnival\r\n&lt;/p&gt;&lt;p&gt;This festival in Basel is a three-day party that welcomes in the warm weather and takes place annually on the Monday following Ash Wednesday. It’s something that’s highly anticipated by both tourists and locals, and it’s definitely Switzerland’s most popular festival. Fasnächtlers dress in elaborate costumes to hide their identities and parade around town with “cliques” (bands playing basler drums and piccolos). All the bars and restaurants in town remain open throughout the entire three days. Everyone here is in a good mood!\r\n&lt;/p&gt;&lt;p&gt;2. Explore Geneva\r\n&lt;/p&gt;&lt;p&gt;As the third largest city in Switzerland, Geneva offers spectacular views of the city’s lake (Lake Geneva), the world’s largest fountain, the UN, a historic city center, and a collection of international restaurants to satisfy anyone’s palate (thanks to the UN buildings in town). While you’re here make sure you check out the Geneva’s Art and History Museum or the Red Cross and Red Crescent Museum. There are 40 museums here in total!\r\n&lt;/p&gt;&lt;p&gt;3. Hike Mt. Pilatus\r\n&lt;/p&gt;&lt;p&gt;Located right outside the city of Lucerne, this beautiful mountain has breathtaking views of the alps. From the city, you can take a cable car to the top or (better yet) hike its trails to the top to look out over the Swiss Alps. There are some easier trails around the northern side of Pilatus, as well as other attractions in the summer months such as a ropes course.&lt;/p&gt;&lt;p&gt;4. Picnic at the Rhine Falls\r\n&lt;/p&gt;&lt;p&gt;Pack a picnic lunch and look out at your view of Europe’s largest waterfall. If you hop on a boat tour you can get extra close to the giant rock in the middle of the falls, and you’ll also experience the Rhine Falls Basin. Nearby in the town of Schaffhausen, you’ll find a medieval castle which also houses a hostel for cheap but interesting accommodations.\r\n&lt;/p&gt;&lt;p&gt;5. Explore St. Gallen\r\n&lt;/p&gt;&lt;p&gt;The seventh largest city in Switzerland, St. Gallen boasts beautiful museums, colorful murals, and one-of-a-kind architecture. It doesn’t receive as much tourist traffic as the other cities and regions around the country, but it’s a fun town full of students and you’re likely to befriend a few locals during your visit. Must-do: visit the Baroque cathedral and the Abbey Library, which is home to nearly 170,000 documents. Some are hand-written and over a thousand years old!\r\n&lt;/p&gt;&lt;p&gt;6. Visit the Old Villages\r\n&lt;/p&gt;&lt;p&gt;Visit the Graubunden area of the country, where you’ll find villages with houses dating back to the 13th century. Here they also speak an ancient language called Romanch, which has died out everywhere else in the country and the locals take great pride in keeping the tradition alive. Of course, it’s a haven for nature lovers – there are 615 lakes and 150 valleys in the region. Visiting here is a true Swiss Alpine experience.\r\n&lt;/p&gt;&lt;p&gt;7. Have a romantic time in Montreux\r\n&lt;/p&gt;&lt;p&gt;With a picturesque castle (Chateau de Chillo) lying at the edge of a lake, this area makes for a pretty romantic destination. Tour the castle, which dates all the way back to the 12th century and inspired the likes of Lord Byron, Mary Shelley, and more. The town was also the home of Freddie Mercury and there is a statue here in his honor. It costs 12.50 CHF ($12.55 USD) to visit the castle.\r\n&lt;/p&gt;&lt;p&gt;8. Discover rural culture in Appenzell\r\n&lt;/p&gt;&lt;p&gt;This small village of 7,000 lies in the canton of Appenzell Innerrhoden. There are no cars and the village has upheld much of its local traditions and culture, including dance and folk music. It’s an incredibly picturesque little town, with frescoed buildings and narrow alleyways. Its location near the foot of the Alpstein mountains makes it a great gateway for participating in summer and winter outdoor activities, like hiking and skiing. Take the Appenzell Railway to Wasserauen, and explore the fascinating prehistoric Wildkirchli caves (inhabited around 40,000 years ago).\r\n&lt;/p&gt;&lt;p&gt;9. Visit Lucerne\r\n&lt;/p&gt;&lt;p&gt;You can’t get much more of a typical Swiss destination than Lucerne. Located on the beautiful Lucerne Lake, the city offers a wonderful combination of urban life and nature. Spend some time in the old town, especially Weinmarkt, surrounded by medieval guildhalls and decorative buildings. Cross Chapel Bridge, the world’s oldest surviving truss bridge, and pay attention to the 17th-century ceiling paintings showing events from Lucerne’s history.\r\n&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Switzerland Travel Costs\r\n&lt;/p&gt;&lt;p&gt;Accommodation – Hostel dorms average 30 CHF ($30 USD) per night, but in some major cities, they can run as high 50 CHF ($50 USD). Private hostels rooms range from 80-120 CHF ($81-121 USD) a night for rooms that sleep two. Most hostels offer free linens, WiFi, and some include breakfast. Hotels are super expensive. You should expect to spend between 90-120 CHF ($90-121 USD) per night for the most basic of rooms. For something a little nice and more spacious, look closer to 150-200 CHF ($151-202 USD) per night. A much better alternative to hotels is Airbnb, where a shared room in someone’s house typically costs 30 CHF ($30 USD) a night and an entire apartment is about 60 CHF ($60 USD).\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Food – Although eating out is very pricey (as an easy comparison: Starbucks coffee is 8 CHF/$8 USD while McDonald’s is 15 CHF/$15 USD), you can keep your spending in check by going to the local supermarkets and buying your own groceries. You’ll spend around 130 CHF ($131 USD) per week for basics like pasta, sandwich ingredients, sauce, rice, eggs, and fruits and vegetables. Supermarkets also sell pre-made meals for between 5-9 CHF ($5-9 USD). Bars and cafés are the cheapest food option, cost about 9-15 CHF ($9-15 USD) for a lunch special. Restaurants with table service are around 20 CHF ($20 USD) for lunch and 40 CHF ($40 USD) for dinner (starter, main, and drink) to start (prices go up from there and I saw some Italian restaurants asking 35 CHF ($35 USD) per main course!! That’s expensive pasta!). You’ll typically find pizzas for around 20 CHF ($20 USD) in a restaurant. If you’re dining out (but still trying to stick to a budget), you’ll spend an average of 45 CHF ($45 USD) a day on food. From there, the sky is the limit! For people who want to cook and eat the occasional meal out, expect to spend around 20 CHF ($20 USD) per day.\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Activities – Most museums cost around 10 CHF ($10 USD) to enter (if you are a student, you’ll save 2-4 CHF ($2-4 USD) off the price of your admission (be sure to have your student ID with you). All day hiking excursions or adventure activities begin around 70 CHF ($70 USD). Paragliding costs about 160 CHF ($161 USD) and a bit more in the winter. Ski and snowboard lift tickets can cost anywhere from 27-75 CHF ($27-75 USD) per day (depending on the mountain), and 6-day passes cost 4-5 times the price of the daily pass, so if you’re staying for a while, buy that.\r\n&lt;/p&gt;&lt;p&gt;Backpacking Switzerland Suggested Budgets\r\n&lt;/p&gt;&lt;p&gt;For those backpacking through Switzerland, budget at least 70-108 CHF ($70-110 USD) per day. This is a suggested budget assuming you’re staying in a hostel, cooking most of your meals or eating fast food, and using local transportation or mostly walking. This is also assuming you’re enjoying plenty of free nature, or an occasional museum.\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;If you Couchsurf, cook all your food, and rideshare, you could probably do the country between $50-70 USD per day. It would be a tight budget but it would be doable.\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;For a mid-range budget of 230-270 CHF ($235-275 USD) per day, you’ll get to eat mostly fast food meals, stay in private hostel rooms, do some intercity trips, and opt for a few outdoor excursions or other attractions.\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;For a luxury budget of 490+ CHF ($500+ USD) per day, you can afford to eat out at restaurants, stay in nice hostels, have more flexibility with intercity travel, and enjoy more expensive activities (like multi-day ski passes or tours).\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Accommodation\r\n&lt;/p&gt;&lt;p&gt;Food\r\n&lt;/p&gt;&lt;p&gt;Transportation\r\n&lt;/p&gt;&lt;p&gt;Attractions\r\n&lt;/p&gt;&lt;p&gt;Average Daily Cost\r\n&lt;/p&gt;&lt;p&gt;Backpacker\r\n&lt;/p&gt;&lt;p&gt;$30-50\r\n&lt;/p&gt;&lt;p&gt;$20\r\n&lt;/p&gt;&lt;p&gt;$10\r\n&lt;/p&gt;&lt;p&gt;$10-30\r\n&lt;/p&gt;&lt;p&gt;$70-110\r\n&lt;/p&gt;&lt;p&gt;Mid-Range\r\n&lt;/p&gt;&lt;p&gt;$81-120\r\n&lt;/p&gt;&lt;p&gt;$60\r\n&lt;/p&gt;&lt;p&gt;$25\r\n&lt;/p&gt;&lt;p&gt;$70\r\n&lt;/p&gt;&lt;p&gt;$235-275\r\n&lt;/p&gt;&lt;p&gt;Luxury\r\n&lt;/p&gt;&lt;p&gt;$200\r\n&lt;/p&gt;&lt;p&gt;$100\r\n&lt;/p&gt;&lt;p&gt;$100\r\n&lt;/p&gt;&lt;p&gt;$100-200\r\n&lt;/p&gt;&lt;p&gt;$500+\r\n&lt;/p&gt;&lt;p&gt;Switzerland Travel Guide: Money Saving Tips\r\n&lt;/p&gt;&lt;p&gt;Switzerland is a very expensive country. There’s no hiding that fact. But there are plenty of ways to save money in the country so you don’t go bankrupt while visiting. Here are some helpful, high value ways I lowered my costs:\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Have an ISIC Card – To save 20-50% on the cost of admission to museums and other tourist attractions, be sure to present a valid student card. The ISIC is typically accepted in places where a foreign student ID is not.\r\n&lt;/p&gt;&lt;p&gt;Use Couchsurfing – It’s a service that lets travelers stay with locals for free. It was a lifesaver that allowed me to keep my costs down the most. Since a lot of travelers use this service, make your requests for hosts early.\r\n&lt;/p&gt;&lt;p&gt;Use BlaBlaCar – Transportation is very expensive, even more so than accommodation. Most intercity trains are around 50 CHF ($50 USD). That adds up too quickly! Instead, use the ride-sharing website BlaBlaCar to avoid the trains and meet locals. A word of caution: Be advised that many rides cancel. I had three rides cancel on me at the last minute (and one guy who just failed to even show up), so the service requires some flexibility. But when it works, it’s awesome.\r\n&lt;/p&gt;&lt;p&gt;Use hotel points – Hotel reward points are a lifesaver in an expensive destination, where even hostels are expensive and the chance of getting a Couchsurfing host is small. Rack up a few hotel points by travel hacking before your trip and burn them while you stay in the country. Most hotel sign-up bonuses are around 60,000 points, which is worth about five nights at the chain hotels like Hilton, Marriott, or Starwood (just make sure you stay at their cheaper properties. Sorry, no W for you!).\r\n&lt;/p&gt;&lt;p&gt;Don’t drink – Drinking is not cheap here. Most beers are around 8 CHF ($8 USD). (Plus, who wants to hike while hung over?) Most wines are between 10-25 CHF ($10-25 USD) a bottle. If you must drink, stick to hostel bars where you can enjoy 2-for-1 happy hours and cheap drinks for around 5 CHF ($5 USD) or buy your beers at grocery stores for as little was 2 CHF ($2 USD).\r\n&lt;/p&gt;&lt;p&gt;Cook – With sit-down restaurants costing around 40 CHF ($40 USD) per meal per person, eating out in Switzerland can be very costly, so buy your groceries. A week’s worth of food (bread, pasta, rice, eggs, vegetables, cheese, deli meats for sandwiches, and some assorted fruit) will cost you 75-100 CHF ($75-101 USD). The major supermarkets are Migros, COOP, and Spar. COOP is the most expensive.\r\n&lt;/p&gt;&lt;p&gt;Go veggie – Meat is expensive in Switzerland. Every Swiss resident or expat I talked to told me about how they limit their meat consumption because it costs so much. Stick to veggies and avoid buying meat for your meals (especially beef). While I was trolling supermarkets and butchers for grocery prices (travel writing is glamorous, huh?!), I found a pound of meat was 12-14 CHF ($12-14 USD). At that price, stick to deli meats for protein!\r\n&lt;/p&gt;&lt;p&gt;Use lunch specials – If you are going to eat out, do so during lunch when most lunch specials at cafes and restaurants cost around 10-19 CHF ($10-19 USD). Moreover, stick to the ethnic restaurants like Chinese, Middle Eastern, Indian, or Thai for the best deals and biggest portions (and closer to that 10 CHF/$10 USD price). Lunch specials are a great way to get a lot of bang for your buck and to enjoy the dinner menu but at a cheaper set menu price.\r\n&lt;/p&gt;&lt;p&gt;Bring a refillable water bottle – At 2-4 CHF ($2-4 USD) a bottle, that’s a lot of money spent on water after a few days. The water in Basel is safe to drink, so refill your bottle before you go out to save money.\r\n&lt;/p&gt;&lt;p&gt;Book your trains early – While a train ride is a cheaper way to travel than the plane, you can get even cheaper rates by booking your train ticket early. Swiss Rail also offers one-day and weekend group passes to look into.\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Where To Stay in Switzerland\r\n&lt;/p&gt;&lt;p&gt;Hostels are the way to go in Switzerland! Fortunately there are plenty of clean, well-maintained hostels around. My suggested places are:\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Balmers (Interlaken)\r\n&lt;/p&gt;&lt;p&gt;Funny Farm (Interlaken)\r\n&lt;/p&gt;&lt;p&gt;Youthhostel (Zurich)\r\n&lt;/p&gt;&lt;p&gt;City Backpacker – Hostel Biber (Zurich)\r\n&lt;/p&gt;&lt;p&gt;City Hostel (Geneva)\r\n&lt;/p&gt;&lt;p&gt;Nyon Hostel (Geneva)\r\n&lt;/p&gt;&lt;p&gt;Youthhostel (Bern)\r\n&lt;/p&gt;&lt;p&gt;Bern Backpackers Hotel &amp;amp; Hostel Glocke (Bern)\r\n&lt;/p&gt;&lt;p&gt;How to Get Around Switzerland\r\n&lt;/p&gt;&lt;p&gt;Public Transportation – Cities and towns in Switzerland are incredibly well connected with trams, buses, funiculars, trains, etc. Each mode of transportation is safe, clean, and reliable. A single fare will usually cost between 2.50-5 CHF ($2.50-5 USD) depending on the length of time and number of zones you travel.\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Uber is available in Basel, Geneva, and Zurich. Otherwise, taxi fare is expensive!\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;The larger cities also have excellent public bike sharing and car sharing programs. PubliBike and Mobility let you rent bikes and cars via their app, starting at around 4.50 CH per 30 minutes for bicycles and 0.55 CH per kilometer for car rentals.\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;You should consider getting a Swiss Half Fare Card. It will allow you to travel by train, bus, boat, and most mountain railways at half the price for one full month, and it only costs 120 CHF ($121 USD). This will only be cost effective if you intend to spend more than 240 CHF ($242 USD) on public transportation.\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;If you’re staying awhile and plan on cramming a LOT into your itinerary, you might want to look into getting a Swiss Travel Pass. It’s steep in price – ranging from 225 CH ($227 USD) for 3 consecutive days to 485 CH ($490 USD) for 15 consecutive days (there are non-consecutive passes as well) – but it could be worth your time. It covers all public transit (train, boat, bus), free travel on panorama trains, admission to 500 museums, mountain excursions, and more. The card will also hold your Mobility and PubliBike memberships, and any MobilSki passes for the resorts.\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;If you’re considering the Swiss Half Fare Card or the Swiss Travel Pass, use the sbb.ch website to figure out the full fares for some of the trips you plan to make. This is the best way to figure out if either card is cost effective for you.\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Train – Train is the best way to travel in Switzerland, and is the most preferred method for locals. It’s economical and efficient. For example, Bern to Geneva (a two-hour train) costs around 30 CHF ($30 USD). A two-hour trip from Zurich to Interlaken is about 35 CH ($35 USD), while a 1.5 hour trip from Zurich to Bern is around 25 CH ($25 USD). Expect to pay anywhere between 30-50 CHF ($30-50 USD) for a second-class train ticket between cities.\r\n&lt;/p&gt;&lt;p&gt;As mentioned above, if you plan on doing a lot of train travel, consider the Swiss Travel Pass or the Half Fare Card.\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Bus – Flixbus offers a few routes around the country. A 90-minute ride from Zurich to Bern starts at 13 CH ($13 USD), while a 5-hour journey from Zurich to Geneva starts at 26 CH ($26 USD).\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Flying – The country is so tiny, there’s no need to fly. It’s expensive and not worth the hassle. Take the train or bus!\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Ridesharing – Using a ridesharing service like BlaBlaCar is one of the best ways to get around the country, although it does require some flexibility! It lets you share rides with vetted local drivers by pitching in for gas. You simply request a seat, they approve, and off you go! It’s a cheaper and more interesting way travel than by bus or train!\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Hitchhiking – Hitchhiking in Switzerland is a great way to get around, although it’s legal to hitchhike on motorways (it’s fine to do at gas stations though). It’s a common practice in the mountain regions and country areas, where public transit isn’t as readily available. Hitchwiki.org is a great resource.\r\n&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;When to Go to Switzerland\r\n&lt;/p&gt;&lt;p&gt;The right time to visit Switzerland depends entirely on what you’d like to do. Are you planning a ski trip? Sampling all the chocolate? Hiking the Alps?\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Most visitors come in the summer season, from May to September (although in the mountains temperatures don’t really start warming up until June). July and August has the warmest temperatures, with snow-free hiking trails and longer days. If you’re around on August 1st, you’ll witness tons of celebrations for Swiss National Day (fireworks!). Peak temperatures are 65°-82°F (18 to 28 °C), with almost no humidity.\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;The shoulder seasons are from around April to early May and late October to the end of November, which is known in Switzerland as Zwischenzeit – the “between time” for the ski and summer seasons. It’s a good time for city hopping, but the ski resort towns are completely quiet and a lot of things are closed. The weather can also be unpredictable.\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;How to Stay Safe in Switzerland\r\n&lt;/p&gt;&lt;p&gt;Switzerland is one of the safest countries in the world, including for solo travelers and solo female travelers. The most common type of crime is pickpocketing in tourist-heavy areas. In some cities, like Geneva, petty crime is on the rise.\r\n&lt;/p&gt;&lt;p&gt;If you’re traveling in the mountains, keep an eye on weather reports and forecasts. The weather can be extreme! If you’re prone to altitude sickness you will also want to prepare accordingly.\r\n&lt;/p&gt;&lt;p&gt;Always trust your gut instinct. If a taxi driver seems shady, stop the cab and get out. If your hotel is seedier than you thought, get out of there. Make copies of your personal documents, including your passport and ID.\r\n&lt;/p&gt;&lt;p&gt;If you don’t do it at home, don’t do it in Switzerland!\r\n&lt;/p&gt;&lt;p&gt;The most important piece of advice I can offer is to purchase good travel insurance. Travel insurance will protect you against illness, injury, theft, and cancellations. It’s comprehensive protection in case anything goes wrong. I never go on a trip without it as I’ve had to use it many times in the past. You can use the widget below to find the policy right for you:\r\n&lt;/p&gt;&lt;p&gt;Skyscanner – Skyscanner is another great flight search engline which searches a lot of different airlines, including many of the budget carriers that larger sites miss. While I always start with Momondo, I use this site too as a way to compare prices.\r\n&lt;/p&gt;&lt;p&gt;Airbnb – Airbnb is a great accommodation alternative for connecting with homeowners who rent out their homes or apartments. (If you’re new to Airbnb, get $35 off your first stay!)\r\n&lt;/p&gt;&lt;p&gt;Hostelworld – This is the best hostel accommodation site out there, with the largest inventory, best search interface, and widest availability.\r\n&lt;/p&gt;&lt;p&gt;Couchsurfing – This website allows you to stay on people’s couches or spare rooms for free. It’s a great way to save money while meeting locals who can tell you the ins and outs of their city. The site also lists events you can attend to meet people (even if you’re not staying with someone).\r\n&lt;/p&gt;&lt;p&gt;Booking.com – The best all around booking site that constantly provides the cheapest and lowest rates. They have a no money down policy, great interface, and the widest selection of budget accommodation. In all my tests, they’ve always had the cheapest rates out of all bookers.\r\n&lt;/p&gt;&lt;p&gt;Switzerland Gear and Packing Guide\r\n&lt;/p&gt;&lt;p&gt;If you’re heading to Switzerland, here are my suggestions for the best travel backpack and tips on what to pack.\r\n&lt;/p&gt;&lt;p&gt;The Best Backpack for Switzerland\r\n&lt;/p&gt;&lt;p&gt;REI Flash 45 PackWhat’s the best backpack for traveling around Switzerland? I recommend the REI Flash 45 Pack. It’s light and comfy, front loading, and fits perfectly in an airplane’s overhead bin.\r\n&lt;/p&gt;&lt;p&gt;Size: 45-47L\r\n&lt;/p&gt;&lt;p&gt;Straps: Thick and cushy with compression technology that pulls the pack’s load up and inwards so it doesn’t feel as heavy.\r\n&lt;/p&gt;&lt;p&gt;Features: Removable top lid, large pocket at the front, hydration compatible, contoured hip belt\r\n&lt;/p&gt;&lt;p&gt;If you want something different, refer to my article on how to choose the best travel backpack for other backpack suggestions.\r\n&lt;/p&gt;&lt;p&gt;What to Pack for Switzerland\r\n&lt;/p&gt;&lt;p&gt;Clothes\r\n&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;1 pair of jeans (heavy and not easily dried, but I like them; a good alternative is khaki pants)\r\n&lt;/p&gt;&lt;p&gt;1 pair of shorts\r\n&lt;/p&gt;&lt;p&gt;1 bathing suit\r\n&lt;/p&gt;&lt;p&gt;1 pair of hiking boots\r\n&lt;/p&gt;&lt;p&gt;5 T-shirts\r\n&lt;/p&gt;&lt;p&gt;1 long-sleeved T-shirt\r\n&lt;/p&gt;&lt;p&gt;1 jacket (seasonal)\r\n&lt;/p&gt;&lt;p&gt;1 pair of flip-flops\r\n&lt;/p&gt;&lt;p&gt;1 pair of sneakers\r\n&lt;/p&gt;&lt;p&gt;6 pairs of socks (I always end up losing half)\r\n&lt;/p&gt;&lt;p&gt;5 pairs of boxer shorts (I’m not a briefs guy!)\r\n&lt;/p&gt;&lt;p&gt;1 toothbrush\r\n&lt;/p&gt;&lt;p&gt;1 tube of toothpaste\r\n&lt;/p&gt;&lt;p&gt;1 razor\r\n&lt;/p&gt;&lt;p&gt;1 package of dental floss\r\n&lt;/p&gt;&lt;p&gt;1 small bottle of shampoo\r\n&lt;/p&gt;&lt;p&gt;1 small bottle of shower gel\r\n&lt;/p&gt;&lt;p&gt;1 towel\r\n&lt;/p&gt;&lt;p&gt;Deodorant\r\n&lt;/p&gt;&lt;p&gt;Small Medical Kit (safety is important!!!)\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;Band-Aids\r\n&lt;/p&gt;&lt;p&gt;Hydrocortisone cream\r\n&lt;/p&gt;&lt;p&gt;Antibacterial cream\r\n&lt;/p&gt;&lt;p&gt;Earplugs\r\n&lt;/p&gt;&lt;p&gt;Doctor-prescribed antibiotics\r\n&lt;/p&gt;&lt;p&gt;Tylenol\r\n&lt;/p&gt;&lt;p&gt;Hand sanitizer (germs = sick = bad holiday)\r\n&lt;/p&gt;&lt;p&gt;Miscellaneous\r\n&lt;/p&gt;&lt;p&gt;\r\n&lt;/p&gt;&lt;p&gt;A key or combination lock (safety first)\r\n&lt;/p&gt;&lt;p&gt;Zip-lock bags (keeps things from leaking or exploding)\r\n&lt;/p&gt;&lt;p&gt;Plastic bags (great for laundry)\r\n&lt;/p&gt;&lt;p&gt;Universal charger/adaptor (this applies to everyone)\r\n&lt;/p&gt;&lt;p&gt;LifeStraw (a water bottle with a purifier)\r\n&lt;/p&gt;&lt;p&gt;Female Travel Packing List&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt; \r\n&lt;/p&gt;&lt;p&gt; \r\n&lt;/p&gt;&lt;p&gt; \r\n&lt;/p&gt;&lt;p&gt;&amp;nbsp;\r\n&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '2020-04-22 11:17:30', 22, 8, 'jpg', 1, 0, 26);
